import logo from "../assets/logo/Logo-removebg.png";
import brandName from "../assets/logo/LogoName-removebg.png";
import Button from "./atom/Button";

const Navbar = () => {

    return (
        <header className="w-full bg-lightGrey sticky top-0 z-50">
            {/*<div className="">*/}
                <div className="relative -mx-4 flex w-full items-center justify-between">
                    <div className="w-50 max-w-full px-4">
                        <a href="/" className="w-full py-5 px-5 flex items-center justify-between">
                            <img
                                src={logo}
                                alt="logo"
                                className="h-20 w-20"
                            />
                            <img
                                src={brandName}
                                alt="brandName"
                                className="object-cover h-14 w-150"
                            />
                        </a>
                    </div>
                    <div className="flex w-full items-center justify-between px-5">
                            <nav>
                                <ul className="block lg:flex">
                                    <ListItem NavLink="/#">Home</ListItem>
                                    <ListItem NavLink="/#">Payment</ListItem>
                                    <ListItem NavLink="/#">About</ListItem>
                                    <ListItem NavLink="/#">Blog</ListItem>
                                </ul>
                            </nav>
                        <div className="hidden justify-end pr-16 space-x-4 sm:flex lg:pr-0">
                            {/*<a*/}
                            {/*    href="/#"*/}
                            {/*    className="rounded-md bg-secondary px-7 py-3 text-base font-medium text-black hover:bg-secondary/50"*/}
                            {/*>*/}
                            {/*    Sign in*/}
                            {/*</a>*/}

                            {/*<a*/}
                            {/*    href="/#"*/}
                            {/*    className="rounded-md bg-primary px-7 py-3 text-base font-medium text-white hover:bg-primary/90"*/}
                            {/*>*/}
                            {/*    Sign Up*/}
                            {/*</a>*/}
                            <Button text="Sign in" bgColor="secondary" textColor="black"/>
                            <Button text="Sign Up" bgColor="primary" textColor="white"/>
                        </div>
                    </div>
                </div>
            {/*</div>*/}
        </header>
    );
};

export default Navbar;

const ListItem = ({ children, NavLink }) => {
    return (
        <>
            <li>
                <a
                    href={NavLink}
                    className="flex py-2 text-base font-medium text-primary hover:text-primary/60  lg:ml-12 lg:inline-flex"
                >
                    {children}
                </a>
            </li>
        </>
    );
};
